  \"2016-07-27T23:04:26.997191\",\n\t\"name\": \"section-7-biological-evaluation-for-sandplain-gerardia-for-prescribed-burn-at-sayville-gra\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Sandplain gerardia is an endangered annual
  plant found on loamy soils of coastal grasslands and serpentine barrens in the northeast.
  Since the mid-1980's, the Sayville grassland has contained the largest remnant population
  of sandplain gerardia on Long Island. Prescribed fire is the preferred management
  tool for creating and maintaining native habitat suitable for sandplain gerardia,
  and most other native grassland plant species. This report outlines the objectives
  of this planned burn and the reasoning behind its value.\",\n\t\"license_title\":
